import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { fetchForms } from '../services/feedbackapi';
import axios from 'axios';

const FormDetailsPage = () => {
  const navigate = useNavigate();
  const { formId } = useParams();
  const [formTitle, setFormTitle] = useState('');
  const [feedback, setFeedback] = useState([]);
  const [ratings, setRatings] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const getFormDetails = async () => {
      setIsLoading(true);
      try {
        const forms = await fetchForms();
        const form = forms.find(f => f.id === parseInt(formId));
        if (!form) {
          throw new Error('Form not found');
        }
        setFormTitle(form.title);

        // Fetch feedback and ratings based on formId
        const feedbackResponse = await axios.get(`http://localhost:3000/feedback/${formId}`);
        const ratingsResponse = await axios.get(`http://localhost:3000/ratings/${formId}`);

        setFeedback(feedbackResponse.data);
        setRatings(ratingsResponse.data);
      } catch (error) {
        console.error('Error fetching form data:', error);
        setError(error.message);
      } finally {
        setIsLoading(false);
      }
    };

    getFormDetails();
  }, [formId]);

  const renderFeedbackTable = () => {
    return (
      <table className="min-w-full bg-white">
        <thead>
          <tr>
            <th className="py-2 px-4 border-b">Institution Name</th>
            {/* Add more headers as necessary */}
          </tr>
        </thead>
        <tbody>
          {feedback.map((item, index) => (
            <tr key={index}>
              <td className="py-2 px-4 border-b">{item.institutionName}</td>
              {/* Add more data cells as necessary */}
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  const renderRatingsTable = () => {
    return (
      <table className="min-w-full bg-white mt-4">
        <thead>
          <tr>
            <th className="py-2 px-4 border-b">Rating</th>
            <th className="py-2 px-4 border-b">Comment</th>
          </tr>
        </thead>
        <tbody>
          {ratings.map((item, index) => (
            <tr key={index}>
              <td className="py-2 px-4 border-b">{item.score}</td>
              <td className="py-2 px-4 border-b">{item.comment}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  if (isLoading) {
    return (
      <div className="flex justify-center items-center h-screen">
        <div className="animate-spin rounded-full h-32 w-32 border-t-2 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container mx-auto px-4 py-8">
        <h1 className="text-3xl font-bold text-red-600 mb-4">Error</h1>
        <p className="text-gray-700 mb-4">{error}</p>
        <button 
          onClick={() => navigate('/')}
          className="bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded transition duration-300 ease-in-out transform hover:-translate-y-1 hover:scale-110"
        >
          Go back to Dashboard
        </button>
      </div>
    );
  }

  return (
    <div className="bg-blue-100 mx-auto px-4 py-8">
      <div className="container mx-auto bg-white shadow-lg rounded-lg p-6 mb-6">
        <h1 className="text-2xl font-bold mb-4">{formTitle}</h1>
        
        <h2 className="text-xl font-semibold mt-6">Feedback Details</h2>
        {renderFeedbackTable()}

        <h2 className="text-xl font-semibold mt-6">Ratings</h2>
        {renderRatingsTable()}
      </div>
    </div>
  );
};

export default FormDetailsPage;
